window.bookSummaryJSON = "<p><i>Renegade Star: Publisher's Pack 3</i> contains audiobooks five and six of the Renegade Star series.</p> <p><i>Renegade Fleet</i>, audiobook five</p> <p>Jace Hughes has successfully crippled the Union, saving a small civilization in the process. With a new army at his side, he sets his sights on Earth, the lost home world of humanity, vowing to finish the job he set out to do.</p> <p>But there is something looming on the horizon: another threat of unspeakable carnage, and it isnâ€™t the Union or the Sarkonians. It may not even be human.</p> <p><i>Renegade Earth</i>, audiobook six</p> <p>Captain Jace Hughes and his band of rebels have managed to outrun the Union at every turn, barely escaping with their lives. What started as a simple transport job has escalated into a war between empires, all for the sake of a child.</p> <p>But a Renegade never backs down. With Titan, a fleet of strike ships, and a newly transformed Sigmond, the crew of <i>The Renegade Star</i> will need to pull out everything they have in order to make their final stand.</p> <p>Suit up, Renegades. The battle for Earth has finally begun.</p>"; 
